import { productBal } from '../../../api/dashboard/dashboard'
import { getYesterday } from '@eladmin/utils/data_format'

export default {
  name: 'ProductBal',
  data() {
    return {
      cardData: []
    }
  },
  props: {
    className: {
      type: String,
      default: 'box-card'
    },
    width: {
      type: String,
      default: '100%'
    },
    height: {
      type: String,
      default: '100%'
    },
    autoResize: {
      type: Boolean,
      default: true
    },
    date: {
      type: String,
      default: getYesterday()
    }
  },
  mounted() {
    productBal(this.date).then(res => {
        this.cardData = res.data
      }
    )
  }
}
